  input: '"TEXT","F3N","","The Committee includes a clear and conspicuous statement
    requesting the required donor information in every solicitation it does.  It also
    includes language informing donors that federal law requires the Committee to
    request such information from anyone who contributes more than $200 annually.  If
    a contribution is received without it, a written request for the information is
    mailed within 30 days informing donors that federal law requires the Committee
    to follow-up and request this donor information from them.  We also include in
    the follow-up request a pre-addressed return envelope.  Also, no solicitation
    for additional funds is made in any best efforts letters that the Committee sends
    out.  Any contributor information received as a result of the Committee''s best
    efforts is reported to the Commission either in an amended report or on the next
